import React from 'react'
import tasksy from './../../images/img-tasksy.png';
import './style.scss';

 function Tasksy() {
  return (
    <div className="project">
    <div className="project-text">
      <h1>Tasksy</h1>
      <p>
      It is an app to help people to improve the work environment! It was developed to assist teams to list all the tasks that needs to be done the workspace, so everyone can collaborate to keep it clean and nice. Tasksy uses the gamification methodology and everyone will be rewarded for the great job done!  Technologies: MERN / REACT / SCSS / NODE.JS
      </p>
    </div>
    <div className="project-image"><img src={tasksy} alt="Myrian Katto"/></div>
  </div>
  )
}


export default Tasksy;
